import React from 'react'
import '../CSS/Work.css'

function WorkPage() {

    var myArray = ["one", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten",];

    return (
        
        <div className="work-page">

            {myArray.map((item) => <div className="items">{item}</div>)}
            
        </div>
    
    
    )
}

export default WorkPage
